import { clickEvent } from "./Utils";
import { SegmentAnalytics } from "./Utils";

const Home = () => {
  const trackButton = () => {
    clickEvent("Article Bookmarked", "click", {
      title: "Snow Fall",
      subtitle: "The Avalanche at Tunnel Creek",
      author: "John Branch",
    });
    new SegmentAnalytics("Article Bookmarked", "click", {
      title: "Snow Fall",
      subtitle: "The Avalanche at Tunnel Creek",
      author: "John Branch",
    });

    const identify = new SegmentAnalytics("UserId", "indentify", "srivathsa", "srivathsakm@gmail.com");
    console.log(identify.event);
  };

  return (
    <div>
      <button onClick={() => trackButton()}>Click Here</button>
    </div>
  );
};

export default Home;
